import React from 'react'
import './YoutubeAudio.css'

class YoutubeAudio extends React.Component {
    render(){
        return(
               <div className="container">
                   <div className="row">
                       <br/>
                       <br/>
                        <div className="col-sm-12"><input placeholder="Youtube link" style={{border:'0px', backgroundColor:'black', padding:'5px', width:'100%'}}></input></div>
                   </div>

               </div>

        )
    }

}
export default YoutubeAudio;
